import Navbar from './component/js/navbar';
import './App.css';
import { useState } from 'react';

function App() {

  const [theme,setTheme] = useState('light')

  return (
    <>
      <Navbar theme={theme} setTheme={setTheme}></Navbar>
    </>
  );
}

export default App;
